import React from "react";
const MapLocalize = () => {
  return (
    <iframe
      title="Google Maps"
      src="https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d20944.85655124466!2d2.2314475!3d48.98951984999999!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sfr!2sfr!4v1704980789411!5m2!1sfr!2sfr"
      width="100%"
      height="80%"
      margin-top="2"
      style={{ border: 0 }}
      allowFullScreen=""
      loading="lazy"
      referrerPolicy="no-referrer-when-downgrade"
    ></iframe>
  );
};

export default MapLocalize;
